pragma solidity >=0.5.0 <0.9.0;

contract SimpleStorage {
    uint256 a;
    uint256 b;
    uint256 c;
    
    function setter(uint256 _a) public {
        a = _a;
    }
    function setter1(uint256 _b) public {
        b = _b;
    }
    function setter2(uint256 _c) public {
        c = _c;
    }

    function getter() public view returns (uint256) {
        return a;
    }
    function getter1() public view returns (uint256) {
        return b;
    }
    function getter2() public view returns (uint256) {
        return c;
    }
}
